import logo from './Assets/exchangelogo.png'
import './App.css';

function App() {
  return (
    <div>
    <div className="video-container">
      <h1>The Grand Exchange <img src={logo} alt='logo' /></h1>
    </div>

        <iframe
          width="560"
          height="315"
          src="https://www.youtube.com/watch?v=Rtp-Slp58GM"
          title="YouTube video player"
          frameborder="0"
          allowfullscreen
        ></iframe>
      </div>
  );
}

export default App;
